const apiKey = '6Qs6dFXbJsut9GY7e39vHkb6I33XNCV1';

const httpCall = fetch(`api.giphy.com/v1/gifs/random?api_key=${ apiKey }`);

httpCall.then( resp => {
    resp.json().then( data => {
        console.log(data);
    })
})
.catch( console.warn )
